import styled from 'styled-components';

export const InputContainer =styled.div`
    width: 100%;
    heigh: 85px;


    display: flex;
    align-items: center;
    justify-content: flex-end;
    font-size: 24px;
    font-family: 'Arial';
    font-weight: bold;

    input {
        width: 100%;
        height: 60px;
        background-color: #000000;
        border: 0;
        padding: 0 10px;
        text-align: right;
        font-size: 24px;
        font-family: 'Arial';
        font-weight: bold;
        color: #00ff00;

    }

    `
